import React from 'react';

export function Switch({ checked, onCheckedChange }) {
  return (
    <label className="switch">
      <input type="checkbox" checked={checked} onChange={(e) => onCheckedChange(e.target.checked)} />
      <span className="slider"></span>
    </label>
  );
}
